I loved my time in Omaha! I only spent one night here but I could have easily stayed a couple more.

After checking in to The Cottonwood Hotel which is in the Blackstone District, I walked across the famous Bob Kerrey Pedestrian Bridge, perused The Old Market, and wandered through the Lauritzen Gardens, The Durham Museum, and the Omaha Zoo. Omaha is such a fun city and I can’t wait to return!

